10.body:
Instantiation output is enabled via jco transpile component.wasm --instantiation sync|async. When using instantiation mode, the output is a JS module with a single instantiate() function. For async instantiation, the instantiate function takes the following signature: export async function instantiate( getCoreModule: (path: string) => Promise<WebAssembly.Module>, imports: { [importName: string]: any }, instantiateCore?: (module: WebAssembly.Module, imports: Record<string, any>) => Promise<WebAssembly.Instance>
): Promise<{ [exportName: string]: any }>; imports allows customizing the imports provided for instantiation. instantiateCore defaults to WebAssembly.instantiate. getCoreModule can typically be implemented as: export async function getCoreModule(path: string) { return await WebAssembly.compile(await readFile(new URL(`./${path}`, import.meta.url)));
} For synchronous instantiation, the instantiate function has the following signature: export function instantiate( getCoreModule: (path: string) => WebAssembly.Module, imports: { [importName: string]: any }, instantiateCore?: (module: WebAssembly.Module, imports: Record<string, any>) => WebAssembly.Instance
): Promise<{ [exportName: string]: any }>; Where instead of promises, all functions are synchronous.

12.body:
As a first step, we might like to look instead this binary black box of a Component and see what it actually does. To do this, we can use jco wit to extract the "WIT world" of the Component ( WIT is the typing language used for defining Components). > jco wit cowsay.wasm
world cowsay { export cow: interface { enum cows { default, cheese, daemon, dragon-and-cow, dragon, elephant-in-snake, elephant, eyes, flaming-sheep } say: func(text: string, cow: option<cows>) -> string; }
} From the above we can see that this Component exports a cow interface with a single function export, say, taking as input a string, an optional cow, and returning a string. Alternatively jco print cowsay.wasm -o out.wat would output the full concrete Wasm WAT to inspect the Component, with all the implementation details (don't forget the -o flag...).

6.body:
To customize the import specifiers used in JS, a --map configuration can be provided to the transpilation operation to convert the imports. For example, jco transpile component.wasm --map my:pkg/interface@1.2.3=./myinterface.js will instead output import { fn } from './myinterface.js'. Where the file myinterface.js would contain the function that is being imported from the interface: export function fn () { // .. function implementation ..
} Map configuration also supports # targets, which means that the interface can be read off of a nested JS object export. For example with a JS file written: export const interface = { fn () { // exported function to be imported from my:pkg/interface }
} We can map the interface directly to this object instead of the entire module using the map configuration: jco transpile component.wasm --map my:pkg/interface@1.2.3=./mypkg.js#interface This way a single JS file can define multiple interfaces together. Furthermore, wildcard mappings are also supported so that using (and quoting for bash compatibility): jco transpile component.wasm --map 'my:pkg/*@1.2.3=./mypkg.js#*' we can map all interfaces into a single JS file reading them off of exported objects for those interfaces.

8.body:
Here's an example of implementing a custom WIT interface in JavaScript: example.wit package test:pkg;
interface interface-types { type some-type = list<u32>; record some-record { some-field: some-type }
}
interface iface { use interface-types.{some-record}; interface-fn: func(%record: some-record) -> result<string, string>;
}
world myworld { import iface; export test: func() -> string;
} When transpiling, we can use the map rules as described in the previous section to implement all interfaces from a single JS file. Given a component compiled for this world, we could transpile it, but given this is only an example, we can use the --stub feature of transpile to inspect the bindings: jco transpile example.wit --stub -o output --map 'test:pkg/*=./imports.js#*' The output/example.js file contains the generated bindgen: import { iface } from './imports.js';
const { interfaceFn } = iface; // ... bindings ... function test () { // ...
} export { test } Therefore, we can implement this mapping of the world with the following JS file: imports.js export const iface = { interfaceFn (record) { return 'string'; }
}; Note: Top-level results are turned into JS exceptions, all other results are treated as tagged objects { tag: 'ok' | 'err', val }.
